  // \u901A\u5E38\u5934\u90E8\u6807\u9898\u90FD\u4F1A\u5305\u88F9\u5728\u4E00\u4E2A View \u5185\u90E8
  // |-- View
  // |--|-- Text
  // |--|--|-- {title}
  // |--|-- {extra}
  //
  /**
   * \u81EA\u5B9A\u4E49\u6837\u5F0F
   */
  titleStyle?: StyleProp<ViewStyle>

  /**
   * \u5206\u7EC4\u540D\u81EA\u5B9A\u4E49\u6587\u5B57\u6837\u5F0F
   */
